INSERT INTO "public"."project" (id,accomplishment_update,action_taken_ia,action_taken_neda,action_to_be_taken_ia,actual_owpa,compliance_to_conditions,cumulative_allotment,cumulative_obligations,date_rre,end_date,icc_nb_action,icc_nb_conditions,implementing_agency_office,issue_detail,issue_type,level_rre,nature_rre,period_performance_end,period_performance_start,ph_id,physical_progress,reason_rre,revised_closing_date,revised_period_performance_end,start_date,target_owpa,title,total_project_amount,total_project_amount_original,executing_agency_id,funding_agency_id,grant_classification_id,original_currency_id,physical_status_id,status_id) VALUES (944,'1.1 dar consulted oversight agencies (neda and dof) for possible amendment of the mou and financing agreement.\n\n1.2 dar proposed for the amendments of such provisions through diplomatic protocol. neda and dof sent confirmation of no objection to the amendments to facilitate dfa issuance of the note verbale endorsing proposed amendments to the italian embassy, as required by dfa. on sept. 21, 2015, the dfa issued the note verbale to the italian embassy endorsing the amendments\n\n1.3 the 20 % italian content was reduced to 5% and the provision requirinf all contracts to be denominated and paid in euros can now be paid either in "pesos or in euros."\n\n2. dar to request supplemental budget funds for project management\n','','','',13.04,'',null,null,'',{ts '2019-04-11 00:00:00.0'},'','',null,'1. need to amend some provisions in the mou between gph and the gov''t of italy. two major issues which needs to be adressed are:\na.) difficulty in complying with the requirement to procure 20% of loan proceeds for goods and services from italy.\nb.) problem in complying with the provision in the italian procurement guidelines requiring that all contracts shall be paid in euros\nthus, all obligations and disbursements from the lp are put on hold.\n\n2. very limited fund allocation for project management; and no provision of vat.','other project-specific issues. peace and order issues. budget and funds flow.','','',{ts '2019-04-11 00:00:00.0'},{ts '2012-12-28 00:00:00.0'},'Italy-1',26.95885879677486,'',null,null,{ts '2013-08-30 00:00:00.0'},48.37,'Italian Assistance to the Agrarian Reform Community Development Support Program (IARCDSP)',2.519017E9,null,212,210,null,null,2,1);
