 were only issued this in february 2016.  ','application/processing/ issuance of clearances/permits/ certificates/approvals from other government offices/agencies/bodies','','',null,null,'8162-PH',63.44946981172907,'',null,null,{ts '2012-10-19 00:00:00.0'},46.21,'Metro Manila Wastewater Management Project',1.7043669999999998E10,null,212,60,null,null,2,1);
