INSERT INTO "public"."project" (id,accomplishment_update,action_taken_ia,action_taken_neda,action_to_be_taken_ia,actual_owpa,compliance_to_conditions,cumulative_allotment,cumulative_obligations,date_rre,end_date,icc_nb_action,icc_nb_conditions,implementing_agency_office,issue_detail,issue_type,level_rre,nature_rre,period_performance_end,period_performance_start,ph_id,physical_progress,reason_rre,revised_closing_date,revised_period_performance_end,start_date,target_owpa,title,total_project_amount,total_project_amount_original,executing_agency_id,funding_agency_id,grant_classification_id,original_currency_id,physical_status_id,status_id) VALUES (998,'on 8 may 2015, neda received dbp request to cancel the remaining undisbursed balance of the loan amounting to jpy3.833 billion.\n\non 17 june 2015, the dof concurred with the dbp’s request for cancellation of the rigp loan. the undisbursed loan balance  was cancelled on 19  june 2015.','','','',null,'on 5 june 2015, neda endorsed to dof cancellation of the undisbursed loan balance amounting jpy3,833 million.  wb and dbp agreed that an exit through cancellation is more beneficial given the time elapsed since the occurrence of typhoon yolanda and bohol earthquake in 2013, and the pending approvals since discussions on the rigp restructuring commenced.  the undisbursed loan balance  was cancelled on 19  june 2015.',null,null,'',{ts '2016-11-30 00:00:00.0'},'','the rigp  was presented anew to the icc-cc on 22 december 2014  wherein the icc-cc approved the request, subject to the finalization and execution of the moa governing duties and obligations of dbm, dof, dpwh, and dbp in the implementation of the project, particularly on the fund transfer mechanism for the 90% ng grant financing.',null,'there were no approved sub-projects under the relending facility upon loan cancellation. dbp requested for project restructuring to support recovery and reconstruction efforts for areas affected by typhoon yolanda, and for change in financing mix to 90% national government grant and 10% loan to encourage sub-borrowers. the neda board, however, deferred decision during its 15 february 2015 meeting.','application/processing/ issuance of clearances/permits/ certificates/approvals from other government offices/agencies/bodies','','',null,null,'PH-8119',null,'',null,null,{ts '2012-10-11 00:00:00.0'},null,'Regional Infrastructure for Growth Project',1.643834E10,null,212,60,null,null,null,1);
